export const data = {
  id: 1,
  status: "active",
  chil: [
    {
      id: 2,
      status: "active",
      chil: [
        { id: 10, status: "active", chil: [] },
        { id: 11, status: "active", chil: [] },
        {
          id: 24,
          status: "active",
          chil: [{ id: 44, status: "active", chil: [] }],
        },
        {
          id: 3,
          status: "active",
          chil: [
            { id: 4, status: "active", chil: [] },
            { id: 5, status: "active", chil: [] },
          ],
        },
      ],
    },
  ],
};
